import * as React from "react";
import { AppData } from "./appdata";

const Objective = () => {
  let { state, dispatch } = React.useContext(AppData);
  return (
    <React.Fragment>
      {" "}
      <section className="res-objective res-editable" id="Objective">
        <h2 className="note rr poly-wrap poly-0">Objective</h2>

        <div class="sticky note-card rr">
          <h4 class="tack">
            <i class="inner"></i>
            <span class="can-edit">Or, why I do this:</span>
          </h4>
          <div
            class="note-card-text pretty-scroll can-edit"
            dangerouslySetInnerHTML={{ __html: state.resume.objective }}
          ></div>
        </div>
      </section>
    </React.Fragment>
  );
};

export default Objective;
